function calculateResultInWords(number){
	
	if(number>=0 && number<=1){
		return "Muy buena salud"
	}
	if(number>=2 && number<=3){
		return "Buena salud"
	}
	if(number>=4 && number<=5){
		return "Salud regular"
	}
	if(number>=6 ){
		return "Mala Salud"
	}
}


